window.bookSummaryJSON = "<p>Reaching level five has allowed Ruwen to stay hidden from the gods and their minions. He just needs to survive the new Ascendant orientation, and he can finally look for his parents. But a secret discovered during orientation rocks Ruwenâ€™s understanding and forces him to face the power of his Cultivation. He finds answers in the Black Pyramid, along with dozens of new questions.</p> <p>With new knowledge, Ruwen works even harder to gain the skills and abilities to battle those who wish him harm. But a betrayal shatters his world, endangering him and his friends. Even if Ruwen survives the aftermath, he may never recover from the terrible truths that are revealed.</p> <p>Because the only thing worse than being betrayed is being betrayed twice.</p>"; 
